{"id":926393,"page":1,"results":[{"author":"CinemaSerf","author_details":{"name":"CinemaSerf","username":"Geronimo1967","avatar_path":"/1kks3YnVkpyQxzw36CObFPvhL5f.jpg","rating":6.0},"content":"Anyone remember the little tune that went with the Edward Woodward television series? Well you won't hear it here in this rather procedural vehicle for Denzel Washington. His usually meticulous planning is compromised by a young lad with a rifle. This leaves "McCall" needing the care of a doctor "Enzo" (Remo Girone) in a small Sicilian town that is about to become the centre of the venal ambitions of "Vincent" (Andrea Scarduzio) and his henchman younger brother "Marco" (Andrea Dodero) who uses his team of thugs to extort from the local businesses. It's only a matter of time before heads clash and, well - you can guess the rest of this actually rather brutally predictable drama. Dakota Fanning appears now and again in a rather unnecessary sub-plot involving the CIA and some Syrian narcotics smugglers that is really undercooked - but for the most part this is really just Denzel being, well, Denzel on his quest to save his new-found friends from the grip of the unscrupulous Camorra. It's overlong for what it is, and I found Washington's performance to be rather sluggish throughout before a denouement that came across as rather simplistically rushed. It's fine, but forgettable.","created_at":"2023-08-31T09:25:28.079Z","id":"64f05c8877d23b010d6b9d83","updated_at":"2023-08-31T09:25:28.205Z","url":"https://www.themoviedb.org/review/64f05c8877d23b010d6b9d83"},{"author":"MovieGuys","author_details":{"name":"","username":"MovieGuys","avatar_path":null,"rating":4.0},"content":"The new Equalizer film franchise is devoid of the moderation, charm and gentlemanly grace of the original television series, with Edward Woodward.

instead, its mired in gratuitous, humiliating, dehumanising violence, with a key character who feels more like the Terminator, than an assassin with a conscience. In short its ugly stuff. I managed about 15 minutes of this, before calling it a day. I will say too, for me, this kind of unnecessarily violent nonsense, is part of whats wrong with the world today. 

In summary, brutally violent, ugly and inaccessible. I'll pass.","created_at":"2023-10-05T02:56:07.891Z","id":"651e25c78c22c0010364e4f2","updated_at":"2023-10-05T21:12:09.705Z","url":"https://www.themoviedb.org/review/651e25c78c22c0010364e4f2"}],"total_pages":1,"total_results":2}
